def predict(triples: list[Triple]) -> str:
    if not triples:
        return ""

    sentences = []
    subject = triples[0].subject
    for triple in triples:
        if triple.predicate == "category":
            sentences.append(f"{subject} is a {triple.object}.")
        elif triple.predicate == "country":
            sentences.append(f"{subject} is in {triple.object}.")
        elif triple.predicate == "location":
            sentences.append(f"{subject} is located in {triple.object}.")
        elif triple.predicate == "dedicatedTo":
            sentences.append(f"{subject} is dedicated to {triple.object}.")
        elif triple.predicate == "designer":
            sentences.append(f"{subject} was designed by {triple.object}.")
        elif triple.predicate == "material":
            sentences.append(f"{subject} is made of {triple.object}.")
        elif triple.predicate == "capital":
            sentences.append(f"The capital of {subject} is {triple.object}.")
        elif triple.predicate == "leader":
            sentences.append(f"The leader of {subject} is {triple.object}.")
        else:
            sentences.append(f"{subject} {triple.predicate} {triple.object}.")

    if len(triples) > 1:
        combined_sentence = ""
        if any(t.predicate == "capital" for t in triples) and any(t.predicate == "location" for t in triples):
            capital_triple = next(t for t in triples if t.predicate == "capital")
            location_triple = next(t for t in triples if t.predicate == "location")
            combined_sentence = f"{location_triple.subject} is located in {location_triple.object}, where the capital is {capital_triple.object}."
        elif any(t.predicate == "currency" for t in triples) and any(t.predicate == "location" for t in triples):
            currency_triple = next(t for t in triples if t.predicate == "currency")
            location_triple = next(t for t in triples if t.predicate == "location")
            combined_sentence = f"{location_triple.subject} is located in {location_triple.object}, where the currency is {currency_triple.object}."
        elif any(t.predicate == "leader" for t in triples) and any(t.predicate == "capital" for t in triples):
            leader_triple = next(t for t in triples if t.predicate == "leader")
            capital_triple = next(t for t in triples if t.predicate == "capital")
            combined_sentence = f"The capital of {capital_triple.subject} is {capital_triple.object}, and the leader is {leader_triple.object}."

        if combined_sentence:
            return combined_sentence
        else:
            return " ".join(sentences)
    else:
        return " ".join(sentences)

